import './App.css';

const App = () => {
  return (
    <div className = "note-app-container">
      <div className = "previous-notes-grid">
        <div className = "previous-note">
          <div className = "previous-note-title">
            <button> Delete </button>
          </div>
        </div>

      <form className = "new-note-form">
        <input placeholder = "Enter title here..." required></input>
        <textarea placeholder = "Enter text here..." rows = {25} required></textarea>
        <button type = "submit"> Create new note </button>
      </form>
      </div>
    </div>
  );
};

export default App;
